  NWR outlines Refuge accomplishments during the 1976 calendar year. The report begins
  by summarizing the weather conditions, water conditions, and food and cover conditions
  during the year. Wildlife- including migratory birds, upland game birds, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
